import React from 'react'
import classes from './GlobalSheet.module.scss'

const Global = () => {
    let globalCases = '123';
    async function getAPI() {
        const url = 'https://corona.lmao.ninja/v2/all?yesterday';
        let data = await fetch(url);
        globalCases = await data.json();
    }
    getAPI();
    console.log(globalCases);
    return (
        <div className={classes.sheet__wrapper}>
            <table>
                <thead>
                    <td>Global cases!</td>
                </thead>
                <tbody>
                    <td></td>
                </tbody>
            </table>
        </div>
    );
};
  
export default Global;
